// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract FundsTransfer {
    address public owner;
    uint256 public contractBalance;

    event FundsDeposited(address indexed depositor, uint256 amount);
    event FundsTransferred(address indexed recipient, uint256 amount);

    constructor() payable {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can call this function");
        _;
    }

    function deposit() external payable {
        require(msg.value > 0, "Value must be greater than zero");

        contractBalance += msg.value;

        emit FundsDeposited(msg.sender, msg.value);
    }

    function transfer(address payable recipient, uint256 amount)
        external
        payable
        onlyOwner
    {
        require(amount > 0, "Amount must be greater than zero");
        require(amount <= contractBalance, "Insufficient contract balance");
        require(recipient != address(0), "Invalid recipient address");

        // Transfer funds to the recipient
        recipient.transfer(amount);
        contractBalance -= amount;

        emit FundsTransferred(recipient, amount);
    }

    function withdraw(uint256 amount) external onlyOwner {
        require(amount > 0, "Amount must be greater than zero");
        require(
            amount <= address(this).balance,
            "Insufficient contract balance"
        );

        // Transfer funds to the owner
        payable(owner).transfer(amount);
        contractBalance -= amount;

        emit FundsTransferred(owner, amount);
    }

    receive() external payable {
        contractBalance += msg.value;
        emit FundsDeposited(msg.sender, msg.value);
    }
}

